webpackJsonp([0x86a3e0ca059e],{5575:function(t,e){t.exports={data:{post:{html:'<p>Andrea <a href="http://andrea.editthispage.com/2002/05/12">mentioned</a> the <a href="http://www.bbc.co.uk/testthenation/">BBC Test the Nation IQ test</a>, although I find it strange to assume that intelligent people would watch TV to test their intelligence. </p>\n<p>And I used to belong to <a href="http://www.mensa.org">Mensa</a>. Then I got kicked out for having Alzheimer\'s... er, I mean I let my membership lapse. I had only joined (based on my SAT scores) to show up my high school classmates. It worked, too.</p>',fields:{title:"IQ Haiku",date:"13 May 2002",url:"https://papascott.de/2002-05-13-iq-haiku/"}}},pathContext:{slug:"/2002-05-13-iq-haiku/",prev:{fields:{title:"Dutch Elections, Fortuyn and Schill",date:"13 May 2002",slug:"/2002-05-13-dutch-elections-fortuyn-and-schill/"}},next:{fields:{title:"Misc 14.05.2002",date:"14 May 2002",slug:"/2002-05-14-misc-14052002/"}}}}}});
